import {BrowerRouter as Router, Route, Switch} from 'react-router-dom';
import SignIn from './pages/SignIn';

export default function Routes() {
    return (
        <Router>
            <Switch>
                <Route path="/signin">
                    <SignIn />
                </Route>
                <Route path="/signin">
                    <SignIn />
                </Route>

                <Route path="/home" component={Home} />
            </Switch>
        </Router>
    );
}
